"use strict";

$("document").ready(function () {
    console.log("test");

    $("#owl-head").owlCarousel({
        items: 4,
        singleItem: true,
        slideSpeed: 2000,
        paginationSpeed: 1000,
        rewindSpeed: 1000,
        pagination: true,
        paginationNumbers: false,
        navigation: true, // Show next and prev buttons
        navigationText: ["<", ">"],
        autoPlay: 4000,
        scrollPerPage: true,
        //   rewindNav: false,
        itemsDesktop: [1199, 4],
        itemsDesktopSmall: [980, 3],
        itemsTablet: [768, 2],
        itemsMobile: [479, 1]
    });

    $("a.nav-link").on("click", function () {
        $(".nav-link").removeClass("active");
        $(this).addClass("active");
    });

    $("a.nav-link").mPageScroll2id({ offset: 80 });

    $(".order_button .btn ").click(function () {
        $.fancybox([{ href: "#order_form" }]);
    });

    $(".special_offer").click(function () {
        $.fancybox([{ href: "#special_offer" }]);
    });

    $("#submit_button").on("click", function () {
        $("#order_form").submit();
    });

    $("#order_form").submit(function () {
        console.log("post");
        $.ajax({
            type: "GET",
            url: "/mail/mail.php",
            data: $("#order_form").serialize()
        }).done(function () {
            $.fancybox([{ href: "#order_thanks" }]);
            setTimeout(function () {
                $.fancybox.close();
            }, 5000);
        });
        return false;
    });
});
